I have a Tooltip component that I want to use in different places in my NextJS application. However, I want to ensure that when a new Tooltip is opened, any previously opened Tooltip is closed. Since these Tooltips are used in different places and don't have a shared scope, they are isolated from each other.

To achieve this, I can use React Context to manage the state of the Tooltips. Here's how I can do it:

1. Create a TooltipContext to manage the state of the Tooltips.
2. Create a TooltipProvider component that will wrap the entire application and provide the TooltipContext.
3. Create a Tooltip component that will use the TooltipContext to manage its state.

Here's the code to implement this:

```jsx
// TooltipContext.js
import { createContext, useState } from 'react';

const TooltipContext = createContext();

export const TooltipProvider = ({ children }) => {
  const [openTooltip, setOpenTooltip] = useState(null);

  const openTooltipHandler = (tooltipId) => {
    setOpenTooltip(tooltipId);
  };

  const closeTooltipHandler = () => {
    setOpenTooltip(null);
  };

  return (
    <TooltipContext.Provider value={{ openTooltip, openTooltipHandler, closeTooltipHandler }}>
      {children}
    </TooltipContext.Provider>
  );
};

export default TooltipContext;
```

```jsx
