import { useContext, useEffect } from 'react';
import TooltipContext from './TooltipContext';

const Tooltip = ({ id, children }) => {
  const { openTooltip, openTooltipHandler, closeTooltipHandler } = useContext(TooltipContext);

  useEffect(() => {
    if (openTooltip === id) {
      // Show the tooltip
    } else {
      // Hide the tooltip
    }
  }, [openTooltip, id]);

  const handleMouseEnter = () => {
    openTooltipHandler(id);
  };

  const handleMouseLeave = () => {
    closeTooltipHandler();
  };

  return (
    <div onMouseEnter={handleMouseEnter} onMouseLeave={handleMouseLeave}>
      {children}
      {openTooltip === id && <div className="tooltip">Tooltip content</div>}
    </div>
