};

export default Tooltip;
```

```jsx
// _app.js
import { TooltipProvider } from '../context/TooltipContext';

function MyApp({ Component, pageProps }) {
  return (
    <TooltipProvider>
      <Component {...pageProps} />
    </TooltipProvider>
  );
}

export default MyApp;
```

With this implementation, the Tooltip component will use the TooltipContext to manage its state. When a new Tooltip is opened, the `openTooltipHandler` function will be called with the ID of the Tooltip, and the `openTooltip` state will be updated. This will cause all other Tooltips to close, as they will check the `openTooltip` state and hide themselves if it doesn't match their ID. When the mouse leaves the Tooltip, the `closeTooltipHandler` function will be called, and the `openTooltip` state will be set to `null`, causing all Tooltips to hide.
